import styled from "styled-components";

const ModalEffect = styled.div`
  width: 35rem;
  height: 25rem;
  background-color: #eee;
  position: absolute;
  top: 50%;
  left: 50%;
  margin-top: -7rem;
  margin-left: -20rem;
  padding: 30px 50px;
  box-sizing: border-box;
`;

export default ModalEffect;
